■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>環境型バイオハイテク洗剤でエコな暮らしを!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0306/2626al-01.jpg" width="600" height="811"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【応急処置】<br>◆目に入った時はこすらずに、直ぐ水で洗ってください。<br>◆飲み込んだ時は吐かずに水か牛乳を飲む等の処置をしてください。<br>◆異常が残る時は医師に相談してください。<br><br>【注意事項:バス用】<br>◆換気を良くして使用して下さい。<br>◆大理石の浴槽には使用しないでください。<br>◆塗装面は目立たない所で確かめてから使用して下さい。<br>◆一部のプラスチックの浴槽や床では、白く変色する事がありますので長時間放置しないで下さい。　　　　　　　　　</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0306/2626al-02.jpg" width="600" height="524"></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0306/2626al-03.jpg" width="600" height="703"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">浴槽、風呂釜の材質を傷めず、ガンコな湯垢、石けんかすを強力に分解します。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">浴槽、風呂釜の材質を傷めず、ガンコな湯垢、石けんかすを強力に分解します。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">個装サイズ：21×14×31cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：3000g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">界面活性剤(7％ポリオキシアルキレンアルキルエーテル)、金属封鎖剤、溶剤、生分解促進剤、酵素</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6--><style type="text/css">
