【商品説明】<br>泡が浴槽の汚れを包みこみ、すばやく分解してこすらず落します。<br>床や壁のしつこい汚れも軽くこするだけ<br>すばやい水切れで壁の防カビ効果<br><br>商品サイズ：120×215×60<br><br>香り：さわやかシトラスの香り<br><br>成分：界面活性剤［5%　アルキルエーテル硫酸エステルナトリウム］、泡調整剤、キレート剤<br><br>原材料・材質：パウチ：PE、PA<br><br>ご使用上の注意等：●用途外に使わない。<br>●幼児の手の届く所に置かない。<br>●荒れ性の方や長時間使う場合、炊事用手袋を使う。<br>●使用後は手をよく水で洗う。<br>●目より高い所は、スポンジや布につけて洗う。<br>●大理石の浴槽には使用しない。<br>●塗装面は目立たない場所で確かめてから使う。<br>●必ず単独で使用する。<br>●窓を開けるなど、換気をよくして使う。換気扇がある場合は併用する。<br>●シミになることがあるので長時間放置しない。<br>●除菌したい場合は、除菌したい部分に原液をかけた後5分以上放置し、すすぎ流す。<br>※すべての菌を除菌するわけではありません。<br><br><br>原産国：日本<br><br>問い合わせ先：ロケット石鹸株式会社、〒820-0202　福岡県嘉麻市山野2091、電話番号　0948-43-0756<br>商品区分：お風呂掃除用品<br>JANコード：4903367091901<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
